import{_ as a,o as n,c as s,z as e,a as t}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 3.2-5514 Waste Kitchen Grease Fund established.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-5514.md","filePath":"vacode/3.2-5514.md"}'),r={name:"vacode/3.2-5514.md"},i=e("h1",{id:"§-3-2-5514-waste-kitchen-grease-fund-established",tabindex:"-1"},[t("§ 3.2-5514 Waste Kitchen Grease Fund established. "),e("a",{class:"header-anchor",href:"#§-3-2-5514-waste-kitchen-grease-fund-established","aria-label":'Permalink to "§ 3.2-5514 Waste Kitchen Grease Fund established."'},"​")],-1),o=e("p",null,'There is hereby created in the state treasury a special nonreverting fund to be known as the Waste Kitchen Grease Fund, hereafter referred to as "the Fund." The Fund shall be established on the books of the Comptroller. All funds collected under this chapter shall be paid into the state treasury and credited to the Fund. Interest earned on moneys in the Fund shall remain in the Fund and be credited to it. Any moneys remaining in the Fund, including interest thereon, at the end of each fiscal year shall not revert to the general fund but shall remain in the Fund. Moneys in the Fund shall be used solely for carrying out the purposes of this chapter. Expenditures and disbursements from the Fund shall be made by the State Treasurer on warrants issued by the Comptroller upon written request signed by the Commissioner.',-1),d=e("p",null,[t("2010, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0868",target:"_blank",rel:"noreferrer"},"868"),t(".")],-1),h=[i,o,d];function l(c,u,f,p,b,m){return n(),s("div",null,h)}const y=a(r,[["render",l]]);export{g as __pageData,y as default};
